import React,{Component} from 'react';

class MainPage extends Component{

  render(){
    return(
  <div class="row" >
    <div class="col s12 m7 offset-m3">
      <div class="cardes">
        <div class="card-content">
          <h1 white-text> welcome to travel world </h1>
        </div>
      </div>
    </div>
  </div>
    )
  }
}

export default MainPage;
